import React from 'react'

export default function RecipeList({recipes}) {
    return (
        <div>
            {recipes.map(recipe => 
                <>
                    <h1>{recipe.name}</h1>
                    <div>
                        <label>Cook time</label>
                        <span>{recipe.cookTime}</span>
                    </div>
                </>
            )}
        </div>
    )
}
